import React from 'react';


const Resources = () => {
return (
<div className="Instructions container">
    <div className="flow-text">
        <h1>Resources for Healing</h1>
        <ul>
            <h4>Distance Healing</h4>
            <li><a className="siteLink" href="/" >This is a Site Link</a>
            </li>
            <h4>Alternative Medicines</h4>
            <li>This is a Site Link
            </li>

        </ul>
    </div>
</div>
);
};

export default Resources;
